<script>
import { mapGetters } from 'vuex'
import { AuthService } from '../../services/AuthService'
import { master } from '../../helpers/master'
import { ValidationObserver } from 'vee-validate'
import { ValidationProvider } from 'vee-validate/dist/vee-validate.full'
import _ from 'lodash'

export default {
  name: 'Register',
  components: {
    ValidationObserver,
    ValidationProvider
  },
  computed: {
    ...mapGetters('auth', ['isAuth'])
  },
  methods: {
    hasErrors (errors) {
      return !_.isEmpty(errors)
    },
    async submit () {
      const isValid = await this.$refs.observer.validate()
      if (!isValid) {
        return false
      }
      this.register()
    },
    register () {
      this.loader = true
      AuthService.register(this.form)
        .then(response => {
          this.$q.notify({
            message: this.$t('register.success_register'),
            type: 'positive'
          })
          this.$router.replace({ name: 'public.login' })
        })
        .catch(errors => {
          let errArray = master.hasErrors(errors)
          if (errArray) {
            master.setErrors(this.$refs.observer, errArray)
          }
        })
        .then(() => {
          this.loader = false
        })
    }
  },
  data () {
    return {
      loader: false,
      form: {
        username: null,
        email: null,
        email_confirmation: null,
        password: null,
        password_confirmation: null
      },
      form_rules: {
        username: 'required|alpha_num|max:50',
        email: 'required|email|max:50',
        email_confirmation: 'required|confirmed:email',
        password: {
          required: true,
          min: 8,
          regex: /(^[\S]{8,}$)/
        },
        password_confirmation: 'required|confirmed:password'
      }
    }
  },
  beforeRouteEnter (to, from, next) {
    next(vm => {
      if (vm.isAuth) {
        vm.$router.replace({ name: 'public.index' })
      }
    })
  },
  meta () {
    return {
      title: this.$t('page_titles.register_title')
    }
  }
}
</script>

<style scoped>
  .image-background {
    background-image: url('../../assets/custom/register-background.jpg');
  }
  .register-form {
    width: 350px;
  }
</style>
