.material-icons-outlined,
.material-icons-round,
.material-icons-sharp
  user-select none
  cursor inherit
  font-size inherit
  display inline-flex
  align-items center
  justify-content center
  vertical-align middle
.q-panel
  height 100%
  width 100%
  > div
    height 100%
    width 100%
.q-panel-parent
  overflow hidden
  position relative
.q-loading-bar
  position fixed
  z-index $z-max
  transition transform .5s cubic-bezier(0, 0, .2, 1), opacity .5s
  &--top
    left 0 /* rtl:ignore */
    right 0 /* rtl:ignore */
    top 0
    width 100%
  &--bottom
    left 0 /* rtl:ignore */
    right 0 /* rtl:ignore */
    bottom 0
    width 100%
  &--right
    top 0
    bottom 0
    right 0
    height 100%
  &--left
    top 0
    bottom 0
    left 0
    height 100%
.q-avatar
  position relative
  vertical-align middle
  display inline-block
  border-radius 50%
  font-size 48px
  height 1em
  width 1em
  &__content
    font-size .5em
    line-height .5em
  &__content, img:not(.q-icon)
    border-radius inherit
    height inherit
    width inherit
.q-avatar__content--square
  border-radius 0
.q-badge
  background-color $primary
  background-color var(--q-color-primary)
  color white
  padding 2px 6px
  border-radius $generic-border-radius
  font-size 12px
  line-height 12px
  font-weight normal
  vertical-align baseline
  &--single-line
    white-space nowrap
  &--multi-line
    word-break break-all
    word-wrap break-word
  &--floating
    position absolute
    top -4px
    right -3px
    cursor inherit
  &--transparent
    opacity 0.8
.q-banner
  min-height 54px
  padding 8px 16px
  background white
  &--top-padding
    padding-top 14px
  &__avatar
    min-width 1px !important
    > .q-avatar
      font-size 46px
    > .q-icon
      font-size 40px
  &__avatar:not(:empty) + &__content
    padding-left 16px
  &__actions
    &.col-auto
      padding-left 16px
    &.col-all
      .q-btn-item
        margin 4px 0 0 4px
  &--dense
    min-height 32px
    padding 8px
    &.q-banner--top-padding
      padding-top 12px
    .q-banner__avatar
      > .q-avatar, > .q-icon
        font-size 28px
    .q-banner__avatar:not(:empty) + .q-banner__content
      padding-left 8px
    .q-banner__actions
      &.col-auto
        padding-left 8px
.q-bar
  background rgba(0, 0, 0, .2)
  > .q-icon
    margin-left 2px
  > div, > div + .q-icon
    margin-left 8px
  > .q-btn
    margin-left 2px
  > .q-icon:first-child, > .q-btn:first-child, > div:first-child
    margin-left 0
  &--standard
    padding 0 12px
    height 32px
    font-size 18px
    > div
      font-size 16px
    .q-btn
      font-size 11px
  &--dense
    padding 0 8px
    height 24px
    font-size 14px
    .q-btn
      font-size 8px
  &--dark
    background rgba(255, 255, 255, .15)
.q-breadcrumbs
  &__el
    color inherit
  &__el-icon
    font-size 125%
    &--with-label
      margin-right 8px
  &--last a
    pointer-events none
[dir=rtl] .q-breadcrumbs__separator .q-icon
  transform scaleX(-1) /* rtl:ignore */
.q-btn
  position relative
  outline 0
  border 0
  vertical-align middle
  cursor pointer
  padding $button-padding
  font-size $button-font-size
  line-height $button-line-height
  text-decoration none
  color inherit
  background transparent
  transition $button-transition
  min-height 2.572em
  box-shadow $button-shadow
  font-weight $button-font-weight
  text-transform uppercase
  button&
    -webkit-appearance button
  a&
    display inline-flex
  .q-icon, .q-spinner
    font-size $button-line-height
  &.disabled
    opacity .7 !important
  &--standard:not(.disabled)
    &:before
      
      
      
      
      content ''
      position absolute
      top 0
      right 0
      bottom 0
      left 0
      border-radius inherit
      transition $button-transition
    &:active
    &.q-btn--active
      &:before
        box-shadow $button-shadow-active
  &--no-uppercase
    text-transform none
  &--rectangle
    border-radius $button-border-radius
  &--outline
    border 1px solid currentColor
    background transparent !important
  &--push
    border-radius $button-push-border-radius
    border-bottom 3px solid rgba(0, 0, 0, .15)
    &:active,
    &.q-btn--active
      &:not(.disabled)
        transform translateY(3px)
        border-bottom-width 0
    .q-focus-helper, .q-ripple-container
      height auto
      bottom -3px
  &--rounded
    border-radius $button-rounded-border-radius
  &--round
    border-radius 50%
    padding 0
    min-height 0
    height 3em
    width 3em
    min-width 3em
    min-height 3em
  &--flat, &--outline, &--unelevated
    box-shadow none
  &--dense
    padding $button-dense-padding
    min-height 2em
    &.q-btn--round
      padding 0
      height 2.4em
      width 2.4em
      min-height 2.4em
      min-width 2.4em
    .on-left
      margin-right 6px
    .on-right
      margin-left 6px
  &--fab, &--fab-mini
    .q-icon
      font-size 24px
      width 100%
      height 100%
  &--fab
    height 56px
    width 56px
  &--fab-mini
    height 40px
    width 40px
  
  &__content
    transition opacity .3s
    &--hidden
      opacity 0
    &:before
      content ''
  &__progress
    transition transform .3s
    transform-origin top left
    height 100%
    background rgba(255, 255, 255, .25)
    &--dark
      background rgba(0, 0, 0, .2)
.q-btn-dropdown--split .q-btn-dropdown__arrow-container
  padding 0 4px
  border-left 1px solid rgba(255, 255, 255, .3)
.q-btn-dropdown--simple .q-btn-dropdown__arrow
  margin-left 8px
.q-btn-dropdown__arrow
  transition transform .28s
.q-btn-group
  border-radius $button-border-radius
  box-shadow $button-shadow
  vertical-align middle
  > .q-btn-item
    box-shadow none
  > .q-btn-group
    > .q-btn:first-child
      border-top-left-radius inherit
      border-bottom-left-radius inherit
    > .q-btn:last-child
      border-top-right-radius inherit
      border-bottom-right-radius inherit
  > .q-btn-group:not(:first-child) > .q-btn:first-child
    border-left 0
  > .q-btn-group:not(:last-child) > .q-btn:last-child
    border-right 0
  > .q-btn-item:not(:last-child)
    border-top-right-radius 0
    border-bottom-right-radius 0
  > .q-btn-item:not(:first-child)
    border-top-left-radius 0
    border-bottom-left-radius 0
  &--push
    border-radius $button-push-border-radius
    > .q-btn--push
      .q-btn__content
        transition $button-transition
      &:active,
      &.q-btn--active
        &:not(.disabled)
          border-bottom-width 3px
          transform none
          .q-btn__content
            transform translateY(3px)
  &--rounded
    border-radius $button-rounded-border-radius
  &--flat, &--outline, &--unelevated
    box-shadow none
    > .q-btn-item
      box-shadow none
  &--outline
    > .q-separator
      display none
    > .q-btn-item + .q-btn-item
      border-left 0
    > .q-btn-item:not(:last-child)
      border-right 0
  &--stretch
    align-self stretch
    border-radius 0
  &--glossy
    > .q-btn-item
      background-image linear-gradient(to bottom, rgba(white, .3), rgba(white, 0) 50%, rgba(black, .12) 51%, rgba(black, .04)) !important
  &--spread
    > .q-btn-group
      display flex !important
    > .q-btn-item, > .q-btn-group > .q-btn-item:not(.q-btn-dropdown__arrow-container)
      width auto
      min-width 0
      max-width 100%
      flex 10000 1 0%
.q-card
  box-shadow $shadow-2
  border-radius $generic-border-radius
  vertical-align top
  background white
  position relative
  > div, > img
    &:first-child
      border-top 0
      border-top-left-radius inherit
      border-top-right-radius inherit
  > div, > img
    &:last-child
      border-bottom 0
      border-bottom-left-radius inherit
      border-bottom-right-radius inherit
  > div, > img
    &:not(:first-child)
      border-top-left-radius 0
      border-top-right-radius 0
  > div, > img
    &:not(:last-child)
      border-bottom-left-radius 0
      border-bottom-right-radius 0
  > div
    border-left 0
    border-right 0
    box-shadow none
  &--bordered
    border 1px solid $separator-color
  &--dark
    color white
    border-color $separator-dark-color
  &__section
    position relative
    padding 16px
  &__actions
    padding 8px
    .q-btn
      padding 0 8px
    &--horiz
      > .q-btn-item + .q-btn-item
      > .q-btn-group + .q-btn-item
      > .q-btn-item + .q-btn-group
        margin-left 8px
    &--vert
      > .q-btn-item + .q-btn-item
      > .q-btn-group + .q-btn-item
      > .q-btn-item + .q-btn-group
        margin-top 4px
      > .q-btn-group > .q-btn-item
        flex-grow 1
  &__section + &__section
    padding-top 0
  > img
    display block
    width 100%
    max-width 100%
    border 0
.q-carousel
  background-color inherit 
  height 400px
  &__slide
    height 100%
    padding 16px
    background-size cover
    background-position 50%
  &__slides-container
    height 100%
  &__control
    color white
  &__prev-arrow,
  &__next-arrow
    top 50%
    transform translateY(-50%)
    .q-icon
      font-size 46px
  &__prev-arrow
    left 4px
  &__next-arrow
    right 4px
  &__navigation
    padding 0 8px 8px
    left 0
    right 0
    bottom 0
    &-inner
      flex 1 1 auto
    .q-btn
      margin 6px 4px
      padding 5px
    .q-btn:not(.q-carousel__navigation-icon--active)
      opacity .5
    img
      margin 2px
      height 50px
      width auto
      display inline-block
      cursor pointer
      border 1px solid transparent
      vertical-align middle
      opacity .8
      transition opacity .3s
      &:hover, &.q-carousel__thumbnail--active
        opacity 1
      &.q-carousel__thumbnail--active
        border-color white
        cursor default
  &.q-carousel--navigation .q-carousel__slide
    padding-bottom 50px
  &.q-carousel--arrows .q-carousel__slide
    padding-left 56px
    padding-right 56px
  &.fullscreen
    height 100%
.q-message-name, .q-message-stamp, .q-message-label
  font-size small
.q-message-label
  margin (3 * $chat-message-distance) 0
.q-message-stamp
  color inherit
  margin-top 4px
  opacity .6
  display none
.q-message-avatar
  border-radius 50%
  width $chat-message-avatar-size
  height $chat-message-avatar-size
  min-width $chat-message-avatar-size
.q-message
  margin-bottom $chat-message-distance
  &:first-child .q-message-label
    margin-top 0
.q-message-received
  .q-message-avatar
    margin-right 8px
  .q-message-text
    color $chat-message-received-bg
    border-radius $chat-message-border-radius $chat-message-border-radius $chat-message-border-radius 0
    &:last-child:before
      right 100%
      border-right 0 solid transparent
      border-left 8px solid transparent
      border-bottom 8px solid currentColor
  .q-message-text-content
    color $chat-message-received-color
.q-message-sent
  .q-message-name
    text-align right
  .q-message-avatar
    margin-left 8px
  .q-message-container
    flex-direction row-reverse
  .q-message-text
    color $chat-message-sent-bg
    border-radius $chat-message-border-radius $chat-message-border-radius 0 $chat-message-border-radius
    &:last-child:before
      left 100%
      border-left 0 solid transparent
      border-right 8px solid transparent
      border-bottom 8px solid currentColor
  .q-message-text-content
    color $chat-message-sent-color
.q-message-text
  background currentColor
  padding $chat-message-text-padding
  line-height max(1.2, $min-line-height)
  word-break break-word
  position relative
  & + &
    margin-top 3px
  &:last-child
    min-height $chat-message-avatar-size
    .q-message-stamp
      display block
    &:before
      content ''
      position absolute
      bottom 0
      width 0
      height 0
$checkbox-transition = .22s cubic-bezier(0,0,.2,1) 0ms
.q-checkbox
  vertical-align middle
  &__bg
    left 11px
    top 11px
    right auto
    bottom 0
    width 45%
    height 45%
    border 2px solid currentColor
    border-radius 2px
    transition background $checkbox-transition
  &__native
    width 1px
    height 1px
  &__label
    padding-left 4px
    font-size 14px
    line-height 20px
  &.reverse &__label
    padding-right 4px
  &__check
    color white
    path
      stroke currentColor
      stroke-width 3.12px
      stroke-dashoffset 29.78334
      stroke-dasharray 29.78334
  &__check-indet
    width 100%
    height 0
    left 0
    top 50%
    border-color white
    border-width 1px
    border-style solid
    transform translate3d(0, -50%, 0) rotate3d(0, 0, 1, -280deg) scale3d(0, 0, 0)
  &__inner
    width 40px
    min-width 40px
    height 40px
    padding 11px
    outline 0
    border-radius 50%
    color rgba(0, 0, 0, .54)
    &--active, &--indeterminate
      color $primary
      color var(--q-color-primary)
      .q-checkbox__bg
        background currentColor
    &--active
      path
        stroke-dashoffset 0
        transition stroke-dashoffset .18s cubic-bezier(.4,0,.6,1) 0ms
    &--indeterminate
      .q-checkbox__check-indet
        transform translate3d(0, -50%, 0) rotate3d(0, 0, 1, 0) scale3d(1, 1, 1)
        transition transform $checkbox-transition
  &.disabled
    opacity .75 !important
  &--dark
    .q-checkbox__inner
      color rgba(255, 255, 255, .7)
      &:before
        opacity .32 !important
      &--active, &--indeterminate
        color $primary
        color var(--q-color-primary)
  &--dense
    .q-checkbox__inner
      width 20px
      min-width 20px
      height 20px
      padding 0
    .q-checkbox__bg
      left 1px
      top 1px
      width 18px
      height 18px
body.desktop
  .q-checkbox
    &__inner:before
      content ''
      position absolute
      top 0
      right 0
      bottom 0
      left 0
      border-radius 50%
      background currentColor
      opacity .12
      transform scale3d(0, 0, 0)
      transition transform $option-focus-transition
    &:focus:not(.disabled)
      .q-checkbox__inner:before
        transform scale3d(1, 1, 1)
    &--dense:focus:not(.disabled) .q-checkbox__inner:before
      transform scale3d(1.5, 1.5, 1.5)
  .q-table--dense .q-checkbox--dense:focus:not(.disabled) .q-checkbox__inner:before
    transform scale3d(1.4, 1.4, 1.4)
$chip-height = 32px
.q-chip
  vertical-align middle
  border-radius 16px
  outline 0
  position relative
  height $chip-height
  margin 4px
  background #e0e0e0
  color rgba(0,0,0,.87)
  font-size 14px
  padding 7px 12px
  transition .3s
  &--colored
    .q-chip__icon
      color inherit
  &--outline
    background transparent
    border 1px solid currentColor
  &--selected
    .q-avatar
      visibility hidden !important
      width 10px
  .q-avatar
    font-size $chip-height
    margin-left -12px
    margin-right 6px
  &__icon
    color rgba(0,0,0,.54)
    font-size 20px
    margin -4px
    &--left
      margin-right 6px
    &--right
      margin-left 6px
    &--remove
      margin-left 6px
      margin-right -6px
      opacity .6
      transition .3s
      outline none
      &:hover,
      &:focus
        opacity 1
  &__content
    white-space nowrap
  &--dense
    border-radius 12px
    height 24px
    font-size 12px
    padding 0 6px
    .q-avatar
      font-size 24px
      margin-left -6px
      margin-right 4px
    .q-chip__icon
      font-size 14px
      margin 0
      &--left
        margin-right 5px
      &--right
        margin-left 5px
      &--remove
        margin-left 5px
        margin-right -2px
    &.q-chip--selected
      .q-avatar
        width 5px
  &--square
    border-radius $generic-border-radius
    .q-avatar
      border-radius ($generic-border-radius - 1px) 0 0 ($generic-border-radius - 1px)
body.desktop .q-chip--clickable:focus
  box-shadow $shadow-1
.q-circular-progress
  display inline-block
  position relative
  vertical-align middle
  width 1em
  height 1em
  line-height 1
  &.q-focusable
    border-radius 50%
  &__svg
    width 100%
    height 100%
  &__text
    font-size .25em
  &--indeterminate
    .q-circular-progress__svg
      transform-origin 50% 50%
      animation q-spin 2s linear infinite /* rtl:ignore */
    .q-circular-progress__circle
      stroke-dasharray 1 400
      stroke-dashoffset 0
      animation q-circular-progress-circle 1.5s ease-in-out infinite /* rtl:ignore */
@keyframes q-circular-progress-circle
  0%
    stroke-dasharray 1, 400
    stroke-dashoffset 0
  50%
    stroke-dasharray 400, 400
    stroke-dashoffset -100
  100%
    stroke-dasharray 400, 400
    stroke-dashoffset -300
.q-color-picker
  overflow hidden
  background white
  max-width 350px
  vertical-align top
  min-width 150px
  border-radius $generic-border-radius
  box-shadow $shadow-2
  &__header
    height 88px
    input
      line-height 24px
      border 0
    .q-tab--inactive
      background linear-gradient(to top, rgba(0,0,0,.3) 0%, rgba(0,0,0,.15) 25%, rgba(0,0,0,.1))
  &__error-icon
    bottom 2px
    right 2px
    font-size 24px
    opacity 0
    transition opacity .3s ease-in
  &__header-content
    position relative
    background white
    &--light
      color black
    &--dark
      color white
      .q-tab--inactive
        &:before
          content ''
          position absolute
          top 0
          right 0
          bottom 0
          left 0
          background rgba(255, 255, 255, .2)
  &__header-banner
    height 52px
  &__header-bg
    background white
    background-image url('data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAgAAAAICAYAAADED76LAAAAH0lEQVQoU2NkYGAwZkAFZ5G5jPRRgOYEVDeB3EBjBQBOZwTVugIGyAAAAABJRU5ErkJggg==') !important
  &__footer
    .q-tab--inactive
      background linear-gradient(to bottom, rgba(0,0,0,.3) 0%, rgba(0,0,0,.15) 25%, rgba(0,0,0,.1))
  
  &__spectrum
    width 100%
    height 100%
  &__spectrum-tab
    padding 10px
  &__spectrum-white
    background linear-gradient(to right, white, rgba(255, 255, 255, 0))
  &__spectrum-black
    background linear-gradient(to top, black, rgba(0, 0, 0, 0))
  &__spectrum-circle
    width 10px
    height 10px
    box-shadow 0 0 0 1.5px white, inset 0 0 1px 1px rgba(0, 0, 0, .3), 0 0 1px 2px rgba(0, 0, 0, .4)
    border-radius 50%
    transform translate(-5px, -5px)
  &__hue .q-slider__track-container
    background linear-gradient(to right, #f00 0%, #ff0 17%, #0f0 33%, #0ff 50%, #00f 67%, #f0f 83%, #f00 100%) 
    opacity 1
  &__alpha .q-slider__track-container
    color white
    opacity 1
    height 8px
    background-color white
    background-image url('data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAgAAAAICAYAAADED76LAAAAH0lEQVQoU2NkYGAwZkAFZ5G5jPRRgOYEVDeB3EBjBQBOZwTVugIGyAAAAABJRU5ErkJggg==') !important
    &:after
      content ''
      position absolute
      top 0
      right 0
      bottom 0
      left 0
      background linear-gradient(90deg, rgba(255, 255, 255, 0), $grey-7)
  &__sliders
    padding 4px 0 12px
    .q-slider__track-container
      height 9px
    .q-slider__track
      display none
    .q-slider__thumb-container
      top 4px
    .q-slider__thumb
      stroke-width 13px
    .q-slider
      height 20px
      margin-top 8px
      color $grey-9
  
  &__tune-tab
    .q-slider
      margin-left 18px
      margin-right 18px
    input
      font-size 11px
      border 1px solid $grey-4
      border-radius $generic-border-radius
      width 4em
  
  &__palette-rows
    &--editable .q-color-picker__cube
      cursor pointer
  &__cube
    padding-bottom 10%
    width 10% !important
  
  input
    color inherit
    background transparent
    outline 0
    text-align center
  .q-tabs
    overflow hidden
  .q-tab
    &--active
      box-shadow 0px 0px 14px 3px rgba(0,0,0,0.2)
      .q-focus-helper
        display none
  .q-tab__indicator
    display none
  .q-tab-panels
    background inherit
  &--dark
    background $grey-9
    color white
    .q-color-picker__tune-tab input
      border 1px solid alpha(#fff, .3)
    .q-slider
      color $grey-5
.q-date
  display inline-flex
  box-shadow $shadow-2
  border-radius $generic-border-radius
  background white
  max-width 100%
  .q-btn
    font-weight normal
  &--bordered
    border 1px solid $separator-color
  &__header
    border-top-left-radius inherit
    color white
    background-color $primary
    background-color var(--q-color-primary)
    padding 16px
  &__content
    outline none
  &__header-link
    opacity .64
    outline 0
    transition opacity .3s ease-out
    &--active, &:hover, &:focus
      opacity 1
  &__header-subtitle
    height 24px
    font-size 14px
    line-height 1.75
    letter-spacing 0.00938em
  &__header-title-label
    font-size 24px
    line-height 1.2
    letter-spacing 0.00735em
  &__view
    height 100%
    width 100%
    min-width 288px
    padding 16px
  &__navigation
    height 12.5%
    > div:first-child
      width 8%
      min-width 24px
      justify-content flex-end
    > div:last-child
      width 8%
      min-width 24px
      justify-content flex-start
  &__calendar-weekdays
    height 12.5%
    > div
      opacity .38
      font-size 12px
  &__calendar-item
    display inline-flex
    align-items center
    justify-content center
    vertical-align middle
    width 14.285% !important
    height 12.5% !important
    position relative
    > div, button
      width 32px
      height 32px
      border-radius 50%
    > div
      line-height 32px
      text-align center
    &--out
      opacity .18
    &--fill
      visibility hidden
