img
  &.responsive
    max-width 100%
    height auto
  &.avatar
    width 50px
    height 50px
    border-radius 50%
    box-shadow $shadow-1
    vertical-align middle
.q-video
  position relative
  overflow hidden
  border-radius inherit
  iframe, object, embed
    width 100%
    height 100%
.q-virtual-scroll
  &:focus
    outline none
  &__padding
    background linear-gradient(
      transparent,
      transparent 20%,
      rgba(128, 128, 128, .03) 20%,
      rgba(128, 128, 128, .08) 50%,
      rgba(128, 128, 128, .03) 80%,
      transparent 80%,
      transparent
    )
    background-size 100% 50px
    
